import React, { Component } from "react";
import Slider from "react-slick";
import '../../static/css/_slick.css'
import '../../static/css/_slickTheme.css'


const photos=[
  {
    name:"photo1",
    url:"https://images.unsplash.com/photo-1596420230916-bacf1f5e8a13?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=634&q=80"
  },
  {
    name:"photo2",
    url:"https://images.unsplash.com/photo-1596420230916-bacf1f5e8a13?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=634&q=80"
  },
  {
    name:"photo3",
    url:"https://images.unsplash.com/photo-1596420230916-bacf1f5e8a13?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=634&q=80"
  },
  {
    name:"photo4",
    url:"https://images.unsplash.com/photo-1596420230916-bacf1f5e8a13?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=634&q=80"
  },
]

export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      fade:true,
      infinite:true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
      className:'slides',
      arrows:true
    }
    return (
      <div>
        <h2> Single Item</h2>
        <Slider {...settings}>
          {photos.map(item=>{
            return(
              <div key={item.url}>
                <img src={item.url} alt={item.name} />
              </div>
            )
          })}
        </Slider>
      </div>
    );
  }
}
